            if (button) {
                button.innerHTML = rotationEnabled ? 'ðŸ§­' : 'ðŸ”„';

            }
            if (rotationEnabled) {
                if (window.DeviceOrientationEvent) {

                        const alpha = event.alpha;  // Compass heading in degrees

                            const mapContainer = document.querySelector('.leaflet-container');
                            if (mapContainer) {

                                mapContainer.style.transform = `rotate(${alpha}deg)`;
                            }
                        }

  (function () {
    function findMapVarName() {
      const scripts = document.getElementsByTagName('script');
      for (let s of scripts) {
        if (!s.innerHTML) continue;
        if (s.innerHTML.includes('L.map(')) {
          const m = s.innerHTML.match(/var\s+(\w+)\s*=\s*L\.map/);
          if (m) return m[1];
        }
      }
      return 'map';
    }

    function updateKmMarkers(zoom) {
      const kmMarkers = document.querySelectorAll('.km-marker[data-km]');

      let interval = 1;        // every 1 km
      if (zoom < 10) {
        interval = 10;         // every 10 km
      } else if (zoom < 12) {
        interval = 5;          // every 5 km
      } else if (zoom < 13) {
        interval = 2;          // every 2 km
      }

      kmMarkers.forEach(el => {
        const km = parseInt(el.getAttribute('data-km') || '0', 10);
        el.style.display = (km % interval === 0) ? '' : 'none';
      });
    }

    window.addEventListener('load', function () {
      const mapVarName = findMapVarName();

      setTimeout(function () {
        const mapObj = window[mapVarName];
        if (!mapObj) return;

        mapObj.whenReady(function () {
          updateKmMarkers(mapObj.getZoom());
        });

        mapObj.on('zoomend', function () {
          updateKmMarkers(mapObj.getZoom());
        });
      }, 300);
    });
  })();

    const timer = setInterval(() => {
      const value = window[varName];
      if (value) {

        cb(value);
        return;
      }
      if (Date.now() - start > 15000) {
        clearInterval(timer);
        console.warn("Timed out waiting for global:", varName);
      }
    }, 100);
  }

    // Zoom-based icon scaling configuration
    const ZOOM_SCALE_CONFIG = {
        minZoom: 8,
        maxZoom: 18,
        minScale: 0.5,
        maxScale: 1.8,
        scaleExponent: 1.2,
        hoverScale: 1.2
    };

    function calculateScale(zoom) {
        const { minZoom, maxZoom, minScale, maxScale, scaleExponent } = ZOOM_SCALE_CONFIG;

        // Normalize zoom level (0-1)
        const normalizedZoom = Math.max(0, Math.min(1, (zoom - minZoom) / (maxZoom - minZoom)));

        // Apply exponential scaling for more natural feel
        const scaledZoom = Math.pow(normalizedZoom, scaleExponent);

        // Calculate final scale
        return minScale + (maxScale - minScale) * scaledZoom;
    }

    function updateIconSizes(zoom) {
        const scale = calculateScale(zoom);
        const markers = document.querySelectorAll('.dynamic-marker-container');

        markers.forEach(marker => {
            const icon = marker.querySelector('.marker-icon');
            const pointer = marker.querySelector('.marker-pointer');
            const emojiIcon = marker.querySelector('.emoji-icon');
            const imageIcon = marker.querySelector('.image-icon');

            if (icon && pointer) {
                // Scale the entire marker
                marker.style.transform = `scale(${scale})`;

                // Adjust emoji/image size within icon
                if (emojiIcon) {
                    emojiIcon.style.fontSize = `${Math.round(16 * scale)}px`;
                } else if (imageIcon) {
                    imageIcon.style.width = `${Math.round(20 * scale)}px`;
                    imageIcon.style.height = `${Math.round(20 * scale)}px`;
                }

                // Add hover effect scaling
                marker.addEventListener('mouseenter', function() {
                    this.style.transform = `scale(${scale * ZOOM_SCALE_CONFIG.hoverScale})`;
                    this.style.zIndex = '1000';
                });

                marker.addEventListener('mouseleave', function() {
                    this.style.transform = `scale(${scale})`;
                    this.style.zIndex = '';
                });
            }
        });
    }

    function updateKmMarkers(zoom) {
        const kmMarkers = document.querySelectorAll('.km-marker[data-km]');

        // Show fewer labels when zoomed out to avoid overlap
        let interval = 1;        // every 1 km
        if (zoom < 10) {
            interval = 10;       // every 10 km
        } else if (zoom < 12) {
            interval = 5;        // every 5 km
        } else if (zoom < 13) {
            interval = 2;        // every 2 km
        }

        kmMarkers.forEach(el => {
            const km = parseInt(el.getAttribute('data-km') || '0', 10);
            el.style.display = (km % interval === 0) ? '' : 'none';
        });
    }

    // Wait for map to be ready and get map variable name
    document.addEventListener('DOMContentLoaded', function() {
        // Find the map variable - it's usually the first one defined
        const scripts = document.getElementsByTagName('script');
        let mapVarName = 'map';

        for (let script of scripts) {
            if (script.innerHTML.includes('L.map(')) {
                const match = script.innerHTML.match(/var\s+(\w+)\s*=\s*L\.map/);
                if (match) {
                    mapVarName = match[1];
                    break;
                }
            }
        }

        // Try to access the map variable
        setTimeout(function() {
            const mapVar = window[mapVarName];
            if (mapVar) {
                // Initialize scaling when map is ready
                mapVar.whenReady(function() {
                    updateIconSizes(mapVar.getZoom());
                    updateKmMarkers(mapVar.getZoom());
                });

                // Update scaling on zoom change
                mapVar.on('zoomend', function() {
                    updateIconSizes(mapVar.getZoom());
                    updateKmMarkers(mapVar.getZoom());
                });


                let zoomTimeout;
                mapVar.on('zoom', function() {
                    clearTimeout(zoomTimeout);
                    zoomTimeout = setTimeout(() => {
                        updateIconSizes(mapVar.getZoom());
                        updateKmMarkers(mapVar.getZoom());
                    }, 50);
                });
            }
        }, 1000);
    });

    // Add CSS for smooth transitions and hover effects
    const style = document.createElement('style');
    style.textContent = `
        .dynamic-marker-container {
            cursor: pointer;

            line-height: 1;
            display: block;

        }

        .image-icon {

            transition: all 0.2s ease;

        .marker-icon {
            position: relative;

                transform: scale(1) translateY(0);
                opacity: 1;
            }
        }
